// C:\Users\ASUS\meditrack-ai\frontend\src\components\Home.js
import React from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

function Home() {
  const { currentUser } = useAuth();

  return (
    <div style={{ textAlign: 'center', marginTop: '50px', padding: '20px', border: '1px solid #eee', borderRadius: '8px', maxWidth: '800px', margin: '50px auto', boxShadow: '0 2px 5px rgba(0,0,0,0.1)' }}>
      <h2 style={{ color: '#007bff' }}>Welcome to Meditrack AI!</h2>
      <p style={{ fontSize: '1.1em', color: '#555', lineHeight: '1.6' }}>
        Your intelligent assistant for analyzing medical reports.
      </p>
      <p style={{ marginTop: '20px' }}>
        {currentUser ? (
          <Link to="/dashboard" style={{ textDecoration: 'none', padding: '10px 20px', background: '#28a745', color: 'white', borderRadius: '5px' }}>Go to Dashboard</Link>
        ) : (
          <>
            <Link to="/signup" style={{ textDecoration: 'none', padding: '10px 20px', background: '#6f42c1', color: 'white', borderRadius: '5px', marginRight: '10px' }}>Sign Up</Link>
            <Link to="/login" style={{ textDecoration: 'none', padding: '10px 20px', background: '#007bff', color: 'white', borderRadius: '5px' }}>Login</Link>
          </>
        )}
      </p>
      <p style={{ marginTop: '30px', fontSize: '0.9em', color: '#888' }}>
        &copy; 2025 MediTrack AI. All rights reserved.
      </p>
    </div>
  );
}

export default Home;
